import React from 'react';
import './App.css';

function App() {
    console.clear();
    return (
        <div className="App">
            <header>
                <p>YouTube Demo</p>
                <input></input>
                <button>Search</button>
            </header>
            <iframe
                type="text/html"
                width="640"
                height="360"
                src="https://www.youtube.com/embed/j__VYXZ-5Cw?autoplay=1&origin=http://example.com"
                frameborder="1"
            ></iframe>
        </div>
    );
}

export default App;
